import React from 'react';
import './styles/navbar.css';
import {Link} from "react-router-dom" ;

const Navbar = () => {
    return ( 
        <div>
            <div className="item">
                <ul className="ul">
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/">Anmelden</Link>
                    </li>
                    <li>
                        <Link to="/">Registrieren</Link>
                    </li>
                </ul>
            </div>
        </div>
        )
}
